import React from 'react';

export const Education = () => {
  return (
    <ul className="education">
      <li><strong>2014-2015</strong>&nbsp; St Clair College, Diploma of Fashion Design</li>
      <li><strong>2015-2016</strong>&nbsp; Niagara College, Diploma of Automotive Technician</li>
      <li><strong>2016-2020</strong>&nbsp; York University, Bachelor's degree of Computer Science</li>
    </ul>
  )
}
